import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Committente from './pages/Committente';
import Impresa from './pages/Impresa';
import Professionista from './pages/Professionista';

function App() {
  return (
    <Router>
      <div style={{ textAlign: 'center', marginTop: '2rem' }}>
        <h1>Esegui un lavoro in quota in sicurezza</h1>
        <Link to="/committente"><button>Sono un Committente</button></Link><br /><br />
        <Link to="/impresa"><button>Sono un Impresa</button></Link><br /><br />
        <Link to="/professionista"><button>Sono un Professionista</button></Link>

        <Routes>
          <Route path="/committente" element={<Committente />} />
          <Route path="/impresa" element={<Impresa />} />
          <Route path="/professionista" element={<Professionista />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
